exports=async function(url,bid,cid,options){const{parseContentPaginate,getLinkNextElement}=await require("transcode/parse_content");return parseContentPaginate(page=>1===page?url:url.replace(".html",`_${page}.html`),"div#htmlContent",{clientOptions:{...(options&&options.clientOptions)},hasNextFn:html=>null!=/\/\d+_\d+\.html/.exec(getLinkNextElement(html))})};